function psolvePainter(){const n=new Date,t=(n.getHours()+1)%12||12,e=(n.getHours()+2)%12||12,d=(n.getHours()+3)%12||12;document.querySelectorAll("#wms_table_dwell_time > tbody:nth-child(2) > tr > td:nth-child(10)").forEach((n=>{let[o]=n.textContent.match(/\d{1,2}(?=:00)/);o=parseInt(o,10),o===t?n.classList.add("late-window"):o===e?n.classList.add("current-window"):o===d?n.classList.add("next-window"):n.classList.add("future-window")})),addCSS()}function addCSS(){const n=document.createElement("style");n.innerText="\n    .late-window {\n      background-color: Red;\n    }\n    .current-window {\n      background-color: Pink;\n    }\n    .next-window {\n      background-color: SkyBlue;\n    }\n    .future-window {\n      background-color: LightGrey;\n    }\n  ",document.head.appendChild(n)}